Verenigde Staten
Horror / Thriller
106 minuten

geregisseerd door Steven R. Monroe
met Jemma Dallender, Joe Absolom en Yavor Baharov

De mooie Jessica is net verhuisd naar New York waar ze, net als vele andere knappe vrouwen, het probeert te maken als model. Maar wat begint als een onschulidige en simpele fotoshoot verandert al snel in een verontrustende situatie. Verkracht, gemarteld en ontvoerd naar een vreemd land, wordt Jessica levend begraven en voor dood achtergelaten. Tegen alle verwachtingen in weet ze echter te ontsnappen en nu zint ze op wraak.



